import React,{useState,useEffect} from "react";
import { Link } from "react-router-dom";


function Movie() {
  const [data,setData] = useState()

  const api = 'https://api.themoviedb.org/3/discover/movie?sort_by=popularity.desc&api_key=9cfc295537684b6dcd1fd57ead573ac4';
  
  useEffect(() =>{
      fetch(api)
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
        setData(data.results);
        
      })
  },[])

  console.log(data)
  
  return (
  <div>
    {
      data.map((ele)=>(
  <Link to={{pathname:`/movie/${ele.id}`}}><p>{ele.title}</p></Link>
      ))
    }
      
  </div>
)

}

export default Movie;
